import React, { Component } from 'react';
import "./RightSide.css";
import ImageLayout from '../ImageLayout';
import covid from "../../../../images/covid.png";
import groups from "../../../../images/groups.png";
import memories from "../../../../images/memories.png";
import messengerKids from "../../../../images/messengerkids.png";
import ads from "../../../../images/ads.png";
import adsmanager from "../../../../images/admanager.png";
import blood from "../../../../images/blood.png";
import business from "../../../../images/business.png";

class RightSide extends Component {
    constructor(props) {
        super(props);
        this.state = { 
            data :[]
         }
    }

    getData=()=>{ //FAke JSON RESPONSE
        let jsondata = [
            {
                "image": "https://scontent.fccu3-1.fna.fbcdn.net/v/t1.6435-1/p148x148/162713656_4172696726074274_4057600099221701280_n.jpg?_nc_cat=109&ccb=1-3&_nc_sid=dbb9e7&_nc_ohc=JZF-KE3J5i8AX_bfiWf&_nc_ht=scontent.fccu3-1.fna&tp=6&oh=d777e7f1cac41c18c54d15ddd673033b&oe=608F5148",
                "text": "Anindya Sankar Dasgupta" 
            },
            {
                "image": covid,
                "text": "COVID-19 Information Centre" 
            },
            {
                "image": groups,
                "text":"Friends"
            },
            {
                "image": memories,
                "text":"Memories"
            },
            {
                "image": messengerKids,
                "text":"Messenger Kids"
            },
            {
                "image": ads,
                "text":"Ad Center"
            },
            {
                "image": adsmanager,
                "text":"Ads Manager"
            },
            {
                "image": blood,
                "text":"Blood Donations"
            },
            {
                "image": business,
                "text":"Business Manager"
            }    
        ];
        this.setState({data : jsondata});
    }

    componentDidMount() {
        this.getData();
    }

    render() { 
        return ( 
            <div className="rightside__container">
                <div className="rightside__header">
                    Contacts
                </div>
                <div className="rightside__content">
                     {
                        this.state.data.map( (item) =>(
                                <ImageLayout image={item.image} text={item.text} />
                        ))
                    }
                </div>
            </div>
         );
    }
}

export default RightSide;
